let data_product = [
  {
    id: 1,
    name: "Black Fur hoodie with warm woolen material inside",
    image: p1_img,
    new_price: 50.0,
    old_price: 80.5,
  },
  {
    id: 2,
    name: "Pink crop-top made up of cotton material",
    image: p2_img,
    new_price: 85.0,
    old_price: 120.5,
  },
  {
    id: 3,
    name: "Gym inner sports bra with silk material",
    image: p3_img,
    new_price: 60.0,
    old_price: 100.5,
  },
  {
    id: 4,
    name: "Deep red strip shirt with neilon material",
    image: p4_img,
    new_price: 100.0,
    old_price: 150.0,
  },
];

export default data_product;
